def binarySearch(arr,t):
    print(arr,t)
    low = 0
    height = len(arr)-1
    while low < height:
        mid = int((low+height)/2)+1
        lo = max(0,mid-1)
        hi = min(mid+1,len(arr)-1)
        print(low,height,lo,hi, arr[hi], arr[lo], arr[mid])
        if t<=arr[hi] and t>=arr[lo]:
            return mid
        elif arr[mid] < t:
            low = mid + 1
        elif arr[mid] > t:
            height = mid - 1

    return -1

def lis(X):
    '''
    找increase序列的leecod解法
    '''
    N = len(X)
    P = [-1]*N
    M = [0]*(N+1)

    L = 0
    for i in range(N):
        #print("L of top: %s, i of top %s" % (str(L), str(i)))
        lo = 1
        hi = L
        while lo <= hi:
            mid = math.ceil((lo+hi)/2)
            if X[M[mid]] < X[i]:
                lo = mid+1
            else:
                hi = mid-1

        newL = lo

        P[i] = M[newL-1]
        M[newL] = i

        if newL > L:
            L = newL
        #print("lo, hi, P, M",(lo,hi,P,M))
        #print("L:",L)
        #print('\n')

    S = [0]*L
    k = M[L]
    for i in range(L-1,-1,-1):
        S[i] = X[k]
        k = P[k]
    print(str(S)[1:-1].replace(',',' '))

def lis_reverse(X):
    '''
    找increase序列的leecod解法修改为decrease
    '''
    N = len(X)
    P = [-1]*N
    M = [0]*(N+1)

    L = 0
    for i in range(N):
        #print("L of top: %s, i of top %s" % (str(L), str(i)))
        lo = 1
        hi = L
        while lo <= hi:
            mid = math.ceil((lo+hi)/2)
            if X[M[mid]] > X[i]:
                lo = mid+1
            else:
                hi = mid-1

        newL = lo

        P[i] = M[newL-1]
        M[newL] = i

        if newL > L:
            L = newL
        #print("lo, hi, P, M",(lo,hi,P,M))
        #print("L:",L)
        #print('\n')

    S = [0]*L
    k = M[L]
    for i in range(L-1,-1,-1):
        S[i] = X[k]
        k = P[k]

    print(str(S)[1:-1].replace(',',' '))

def lis_2(x):
    N = len(x)
    subseq = []
    for i in range(N):
        if i == 0:
            subseq.append([x[i]])
        else:
            for subi in range(len(subseq)):
                if len(subseq[subi])>2:
                    if len(subseq[subi])>1:
                        idx = binarySearch(subseq[subi],x[i])
                        #print(x[i],idx,subseq[subi])
                        if idx!=0 and idx!=-1:
                            newarr = copy.deepcopy(subseq[subi])
                            newarr[idx] = x[i]
                            #print(newarr[:idx+1],newarr,idx)
                            subseq.append(newarr[:idx+1])
                    else:
                        if x[i]>=subseq[subi][0]:
                            subseq[subi].append(x[i])
                elif x[i]>=subseq[subi][-1]:
                    newarr = copy.deepcopy(subseq[subi])
                    newarr.append(x[i])
                    subseq.append(newarr)
            subseq.append([x[i]])
            #print(x[i],subseq)
    #print(subseq)

