    subseq = []
    for i in range(N):
        if i == 0:
            subseq.append([x[i]])
        else:
            for subi in range(len(subseq)):
                if x[i]>=subseq[subi][-1]:
                    newarr = copy.deepcopy(subseq[subi])
                    newarr.append(x[i])
                    subseq.append(newarr)
            subseq.append([x[i]])
    #print(subseq)

